import React, { Component } from 'react';
import styled from "styled-components";
import Link from 'next/link';

const Container = styled.div`
 display: flex;
 flex-direction: column;
 justify-content: center;
 align-items: center;
 margin: 0 auto;
 width: 100%;

`;

const ListCont = styled.div`
  border: 1px solid black;
  margin-top: 10px;
`;

const Title = styled.p`
font-size: 20px;
font-weight: bold;
`;

const Wrap = styled.div`
  padding: 90px 100px 100px 100px;
`;

const ContClose = styled.img`
  width: 30px;
  height: 30px;
`;

const CloseImg = "/x.svg"

const CloseBtn = styled.div`
padding: 10px 0 0 440px;
cursor: pointer;
`;


const Info = (props) => {
  return (
    <Container>
      <ListCont>
          <CloseBtn>
            <ContClose onClick={props.handlebtn}  src={CloseImg} alt="close-button-img" />
          </CloseBtn>
        <Wrap>
          <Title>Total Kasus Covid19 di Indonesia</Title>
          <ul>
            <li>Dikonfirmasi: 170 rb </li>
            <li>Sembuh: 82.236 </li>
            <li>Meninggal: 5.765 </li>
          </ul>
        </Wrap>
      </ListCont>
    </Container>
  )
}

export default Info
